.content .inputGroup input {
    background: #fff;
    color: #545454;
}

@media screen and (max-width: 376px) {
  .vs-tabs--li button.vs-tabs--btn{
    font-size: 12px;
  }
}

.navbar-floating .vx-navbar{
  padding: .3rem 1rem;
}

.setting .vs-popup{
  width: 390px !important;
}

.qDeposit .vs-popup{
  width: 300px !important;
}
.qDeposit .vs-button--text{
  width: 100%;
}
.qDeposit .vs-button--text > span.icon, 
.qDeposit .listWallShow .drop> span.icon {
    width: 20px;
    height: 20px;
    overflow: hidden;
    margin-right: 4px;
}

.qDeposit .vs-button--text > span, 
.qDeposit .listWallShow .drop> span {
    line-height: 20px;
    display: inline-block;
    vertical-align: middle;
    font-size: 18px;
}

.vs-button:not(.vs-radius):not(.includeIconOnly):not(.small):not(.large) {
    padding: 0.75rem 1rem;
}

.wrapper-money {
  display: flex;
  align-items: center;
  white-space: nowrap;
}
.text-money {
  margin-top: 5px;
  font-size: 1.2rem;
  cursor: pointer;
}
.arrow-down-custom {
  margin-top: 7px;
}

.btn-dot {
  width: 39px;
  height: 39px;
  display: flex;
  align-items: center;
  justify-content: center;
  background: #444A5F;
  border-radius: 6px;
  margin-bottom: 5px;
  position: relative;
}

.btn-dot .count {
    position: absolute;
    top: -7px;
    left: calc(50% + 2px);
    display: inline-block;
    overflow: hidden;
    background: #e22a67;
    color: #fff;
    display: flex;
    justify-content: center;
    align-content: center;
    width: 22px;
    height: 22px;
    line-height: 14px;
    border-radius: 50%;
    font-weight: bold;
    font-size: 9px;
    border: 2px solid #02142b;
    padding: 0 2px;
}

@media screen and (max-width: 600px) {
    .btn-dot .count{
        top: -10px;
        line-height: 18px;
        font-size: 12px;
    }
}
.add-money {
  box-shadow: inset 0 -3px 0 0 rgb(0 0 0 / 20%);
  background: linear-gradient(180deg,#facc4f,#d3a25b 50%,#67491d)!important;
  color: #fff!important;
  font-weight: 600;
  border-radius: 10px;
}

.info-money {
  background-color: #2f3342!important;
  padding: 4px 7px;
}
